import React, { Component } from 'react';
import { connect } from 'react-redux';
import { FormattedMessage } from 'react-intl';
import Slider from "react-slick";

class ShareNews extends Component {

    render() {

        return (
            <div className='section-share share-new-section'>
                <div className='section-container'>
                    <div className='section-header'>
                        <span className='title-section'>Kiến thức chia sẻ & Tin tức</span>
                        <button className='btn-section'>Xem thêm</button>
                    </div>
                    <div className='section-content'>
                        <Slider>
                            <div className='section-img'>
                                <div className='img share-new-section'></div>
                                <div className='img-title'>Hồ cá thủy sinh Biotope</div>
                            </div>
                        </Slider>
                    </div>
                </div>
            </div>
        );
    }

}

const mapStateToProps = state => {
    return {
        isLoggedIn: state.user.isLoggedIn,
        language: state.app.language,
        posts: state.posts.allPosts
    };
};

const mapDispatchToProps = dispatch => {
    return {
    };
};

export default connect(mapStateToProps, mapDispatchToProps)(ShareNews);
